commits.content:
@keyframes moveTireBottom {
    from {
        bottom: -300px;
        left: -300px;
    }
    to {
        bottom: -100px;
        left: -100px;
    }
}

@keyframes moveTireTop {
    from {
        top: -600px;
        right: -600px;
    }
    to {
        top: -100px;
        right: -100px;
    }
}
@keyframes moveTireBottomRight {
    from {
        bottom: -300px;
        right: -300px;
    }
    to {
        bottom: -150px;
        right: -100px;
    }
}
@keyframes tireGoBottomLeft {
    from {
        bottom: -100px;
        left: -100px;
    }
    to {
        bottom: -300px;
        left: -300px;
    }
}
@keyframes tireGoBottomRight {
    from {
        bottom: -150px;
        right: -100px;
    }
    to {
        bottom: -300px;
        right: -300px;
    }
}
@keyframes tireGoBottomRightForMobile {
    from {
        bottom: -120px;
        right: -180px;
    }
    to {
        bottom: -300px;
        right: -300px;
    }
}

@keyframes slideToLeft {
    from {
        transform: translateX(0);
        opacity: 1;
    }
    to {
        transform: translateX(100px);
        opacity: 0;
    }
}
@keyframes moveTireBottomRightForMobile {
    from {
        bottom: -300px;
        right: -300px;
    }
    to {
        bottom: -120px;
        right: -180px;
    }
}
